import React, { useState } from "react";
import ReactDom from "react-dom";

export const Contact=()=>{

    const[Fname, setFname] =useState();

    const Names=(event)=>{
         setFname(event.target.value)
    }


    return(
        <>
            <div>
            <form>
            <h1>hello {Fname}</h1>
                <input type="text" placeholder="fullname" onChange={Names} value="" /><br/><br/>
                {/* <input type="number" placeholder="phone nmbr" onChange={Phones} value="" /> */}
                </form>
            </div>
        </>
    )
}

export default Contact;
